INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28033', '15064', 'it', '0', '', 'Questa azione non può essere effettuata. Sei sicuro di voler cancellare i dati personali dagli ordini selezionati?', '0', '', '0', '2018-06-27 08:13:49');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28034', '15065', 'it', '0', '', 'Abbiamo notato che stai sperimentando con Gutenberg: Prova WooCommerce Gutenberg Products Block per un nuovo modo potente di presentare i prodotti negli articoli.', '0', '', '0', '2018-06-27 08:13:49');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28035', '15061', 'ko', '0', '', 'Gutenberg 제품 블록 활성화', '0', '', '0', '2018-06-27 08:13:50');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28036', '15062', 'ko', '0', '', '유효하지 않은 상위 제품으로 인해 속성을 설정할 수 없습니다.', '0', '', '0', '2018-06-27 08:13:50');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28037', '15063', 'ko', '0', '', 'WooCommerce Gutenberg 제품 블록 설치', '0', '', '0', '2018-06-27 08:13:50');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28038', '15064', 'ko', '0', '', '이 작업은 되돌릴 수 없습니다. 선택한 주문에서 개인 데이터를 지우시겠어요?', '0', '', '0', '2018-06-27 12:09:49');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28039', '15065', 'ko', '0', '', 'Gutenberg를 실험하고 있는 것을 확인했습니다. WooCommerce Gutenberg 제품 블록을 사용해 보고 글에서 제품을 특성화하는 강력한 새로운 방법을 찾아보세요.', '0', '', '0', '2018-06-27 12:09:49');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28040', '16034', 'it', '0', '', 'Ciao,\n\nÈ stata effettuata una richiesta per eseguire la seguente azione sul tuo account:\n\n     ###DESCRIPTION###\n\nPer confermare questa azione, fai clic sul seguente link:\n###CONFIRM_URL###\n\nPuoi tranquillamente ignorare ed eliminare questa email se non vuoi\neseguire questa azione.\n\nQuesta email è stata inviata a ###EMAIL###.\n\nSaluti,\na tutti da ###SITENAME###\n###SITEURL###', '0', '', '0', '2018-07-06 09:20:29');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28041', '16035', 'it', '0', '', 'Ciao,\n\nLa tua richiesta di esportazione dei dati personali è stata completata. Puoi\nscaricare i tuoi dati personali facendo clic sul link sottostante. Per privacy\ne sicurezza, cancelleremo automaticamente il file il giorno ###EXPIRATION###,\nquindi scaricalo prima di allora.\n\n###LINK###\n\nSaluti,\na tutti da ###SITENAME###\n###SITEURL###', '0', '', '0', '2018-07-06 21:05:28');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28042', '16036', 'it', '0', '', 'Pagina privacy aggiornata correttamente.', '0', '', '0', '2018-07-06 21:05:28');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28043', '16037', 'it', '0', '', 'Il contenuto suggerito sulla privacy dovrebbe essere aggiunto utilizzando l\'action %s (o successiva). Consultare la documentazione inline.', '0', '', '0', '2018-07-06 21:05:28');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28044', '16038', 'it', '0', '', 'Il contenuto suggerito sulla privacy dovrebbe essere aggiunto solo in wp-admin utilizzando l\'action %s (o successiva).', '0', '', '0', '2018-07-06 21:05:28');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28045', '16039', 'it', '0', '', 'Questi siti web possono raccogliere dati su di te, usare cookie, integrare ulteriori tracciamenti di terze parti e monitorare l\'interazione con essi, incluso il tracciamento della tua interazione con il contenuto incorporato se hai un account e sei connesso a quei siti web.', '0', '', '0', '2018-07-06 21:05:28');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28095', '16068', 'ko', '0', '', '업로드할 공간이 부족합니다. %s KB가 필요합니다.', '0', '', '0', '2018-08-03 10:01:27');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28046', '16034', 'ko', '0', '', '안녕하세요,\n\n다음 계정에 대한 작업요청이 실행됐습니다:\n\n     ###DESCRIPTION###\n\n이를 확인하려면 다음 링크를 클릭해주세요:\n###CONFIRM_URL###\n\n이 작업을 실행하길 원하지 않으시면\n이 이메일을 무시하고 삭제하세요.\n\n이 이메일은 ###EMAIL###로(으로) 보내진 것입니다.\n\n안녕히 계세요,\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-07-13 21:10:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28047', '16035', 'ko', '0', '', '안녕하세요,\n\n개인 데이터 내보내기 요청이 완료됐습니다.\n아래의 링크를 클릭해 자신의 개인 데이터를 다운로드할 수 있습니다.\n개인정보 보호를 위해 ###EXPIRATION###에 파일을 자동으로 삭제할 것입니다,\n따라서 그 이전에 다운로드 해주세요.\n\n###LINK###\n\n이 이메일은 ###EMAIL###로 보냈습니다.\n\n안녕히 계세요,\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-07-14 09:02:18');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28048', '16036', 'ko', '0', '', '개인정보보호 정책 페이지가 성공적으로 업데이트되었습니다.', '0', '', '0', '2018-07-14 09:02:18');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28049', '16037', 'ko', '0', '', '%s를 통해 개인정보보호 정책 페이지를 생성하여야 합니다. 관련 문서를 확인하시기 바랍니다.', '0', '', '0', '2018-07-14 09:02:18');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28050', '16038', 'ko', '0', '', 'wp-admin 안에서 %s 를 통해 개인정보보호 정책 페이지를 생성해야 합니다.', '0', '', '0', '2018-07-14 09:02:18');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28051', '16039', 'ko', '0', '', '이들 웹사이트는 개인 데이터를 수집하거나 쿠키를 사용하거나 추가적인 제 3자 트래킹을 임베드 하거나 해당 임베드된 콘텐츠와 상호작용을 모니터 할 수도 있습니다. 여기에는 계정을 가지고 해당 웹사이트에 로그인했을 경우 임베드된 콘텐츠와 상호작용하는 추적이 포함됩니다.', '0', '', '0', '2018-07-14 09:02:18');
