INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28238', '1488', 'ko', '0', '', '<strong>복제</strong> - 연락처 양식을 복제합니다. 복제된 연락처 양식은 원본으로부터 모든 내용을 물려받지만, 다른 ID를 갖고 있습니다.', '0', '', '0', '2018-09-01 23:32:51');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28239', '1489', 'ko', '0', '', '<strong>편집</strong> - 해당 연락처 양식의 편집 화면으로 이동됩니다. 연락처 양식 제목을 클릭하여 해당 화면으로 이동할 수도 있습니다.', '0', '', '0', '2018-09-01 23:32:51');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28240', '1490', 'ko', '0', '', '<strong>양식</strong>은 HTML 양식의 내용입니다. 양식 요소에 허용된 임의적인 HTML을 사용할 수 있습니다. 여기에 Contact Form 7의 양식-태그를 사용할 수도 있습니다.', '0', '', '0', '2018-09-01 23:32:51');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28241', '1491', 'ko', '0', '', '<strong>메일 (2)</strong>는 메일과 유사하게 작동하는 추가적인 메일 템플릿입니다. 메일 (2)는 메일이 성공적으로 발송되었을 때만 발송된다는 점이 다릅니다.', '0', '', '0', '2018-09-01 23:32:51');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28242', '1492', 'ko', '0', '', '<strong>메일</strong>은 사용자가 제출할 때 이 연락처 양식을 보낼 메일 템플릿(헤더 및 메시지 본문)을 관리합니다. 여기서 Contact Form 7의 양식-태그를 사용할 수 있습니다.', '0', '', '0', '2018-09-01 23:32:51');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28243', '1493', 'ko', '0', '', '<strong>제목</strong>은 연락처 양식의 제목입니다. 이 제목은 연락처 양식을 칭할 때 사용하며, 편집 또한 가능합니다.', '0', '', '0', '2018-09-01 23:32:51');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28244', '1494', 'ko', '0', '', '양식-태그는 폼 내용에서 사용되는 네모 괄호 안에 담긴 단축코드입니다. 메일-태그는 일반적으로 입력 필드를 나타내며, 구성요소는 다음 4부분으로 나뉩니다: 유형, 이름, 옵션 및 값. Contact Form 7은 텍스트 필드, 날짜 필드, 확인상자, 라디오 버튼, 메뉴, 파일 업로드 필드, CAPTCHA, 퀴즈 필드 등의 여러 유형의 양식-태그를 지원합니다.', '0', '', '0', '2018-09-01 23:32:51');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('28245', '1495', 'ko', '0', '', '메일-태그는 모든 메일 및 메일 (2)에서 사용 가능한 네모 괄호 안에 담긴 단축코드입니다. 메일-태그는 대응하는 양식-태그의 입력 필드를 통해 사용자가 입력한 값을 나타냅니다.', '0', '', '0', '2018-09-01 23:32:51');
