INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('29261', '16541', 'ko', '0', '', '경고! 사소한 제한 사항으로 무료 계정을 사용하는 고객에 대해 월 100건의 요청 한도와 EUR만을 기본 통화로 사용할 수 있도록 제한됩니다. 월 1000건이 넘는 요청이 필요하거나 170개의 사용 가능한 기본 통화를 모두 사용하려면 월 최저 10달러부터 시작되는 유료 플랜 중 하나를 선택해야 합니다.', '0', '', '0', '2018-10-24 07:06:58');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('29262', '16542', 'ko', '0', '', 'WooCommerce Multilingual은 또한 쿠키를 사용하여 각 고객 주문의 언어와 통화 및 WooCommerce가 생성한 보고서의 통화를 식별합니다. WooCommerce Multilingual은 통화 정보를 추가하여 이러한 보고서를 확장합니다.', '0', '', '0', '2018-10-24 07:06:58');
