INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('29274', '16571', 'it', '0', '', 'Da ora in poi, troverai tutte le opzioni dei tuoi plugin nel menu YITH Plugins.\nOgni volta che aggiornerai i nostri plugin, troverai una nuova voce in questo menu.\nPer esempio, dopo l\'aggiornamento, le opzioni del plugin (come per esempio quelle di YITH WooCommerce Wishlist, YITH WooCommerce Ajax Search etc.)\nsaranno trasferite nella scheda YITH Plugins.', '0', '', '0', '2018-10-25 08:43:12');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('29275', '16572', 'it', '0', '', 'Se hai acquistato uno dei nostri prodotti prima del 27 gennaio 2015, potrai usufruire di supporto e aggiornamenti (servizi inclusi nella licenza)\nfino al 27 gennaio 2016 e non dovrai riacquistare il prodotto per ottenere una chiave di licenza, poiché prima di questa data il tuo prodotto veniva automaticamente attivato dal nostro sistema.\nDopo il 27 gennaio 2016, invece, se vorrai usufruire di supporto e aggiornamenti dovrai acquistare una nuova licenza e attivarla con il codice che ti verrà\nfornito e che puoi trovare nella tua area riservata su YITH, nella sezione "My licenses".', '0', '', '0', '2018-10-25 08:43:12');
