INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('1487', 'en', 'contact-form-7', '5542e599411994aa1e521658227dab43', '<strong>Contact Form 7 %1$s requires WordPress %2$s or higher.</strong> Please <a href="%3$s">update WordPress</a> first.', '0', '0', 'LINE', '', '10', '', '04247bfeace9a63e6eec2c571115286f', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('1488', 'en', 'contact-form-7', 'a6fdca11cd20cd9feabece957bfcadbb', '<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.', '0', '0', 'LINE', '', '10', '', 'b6e099df716ba84aada7287dc8cc23f6', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('1489', 'en', 'contact-form-7', '4ef427b4f52b8def1ff6563e403ad0aa', '<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.', '0', '0', 'LINE', '', '10', '', 'ea76c2469f54366347c0d04fef3cec30', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('1490', 'en', 'contact-form-7', 'a25ed68c9a8e9cf1208dc06da5ca9e6d', '<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.', '0', '0', 'LINE', '', '10', '', '5880875d721835f16410b86d5cd8c14b', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('1491', 'en', 'contact-form-7', 'ee9be757d9d1fc5edf191c10af054b55', '<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.', '0', '0', 'LINE', '', '10', '', '322cb620832476ea07856f78699980a3', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('1492', 'en', 'contact-form-7', '4573c02dd1f6585f8da85e5d065de084', '<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.', '0', '0', 'LINE', '', '10', '', '74eac5df9f32c130fc7f777145142e33', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('1493', 'en', 'contact-form-7', '8d44de43f8128813c4341ae759f1bc2b', '<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.', '0', '0', 'LINE', '', '10', '', 'c5ed9c58ac7509b05ae78d439c77a948', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('1494', 'en', 'contact-form-7', 'cf1e52339d6aabd416f1b9706826c14a', 'A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.', '0', '0', 'LINE', '', '10', '', 'b1969d732ba400a04aa90bfb6c1e962b', '0', '');
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `word_count`, `translation_priority`) VALUES ('1495', 'en', 'contact-form-7', 'f203d7bf1700903f826c0648ca8c84ac', 'A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.', '0', '0', 'LINE', '', '10', '', '64b230e8e0b79669dc0a20ced17e0ce7', '0', '');
